import React, { useEffect } from 'react'
import { ReactComponent as GithubIcon } from "../../recursos/img/github.svg"
import './styles.css'
import FormCadastro from '../formCadastro'
import { Link } from 'react-router-dom'
import Index from '.../'


export default function Navbar() {

    useEffect(
        () => {
            const url = window.location.href
            const res = url.split('?')
        }
    )


    const retornarCadastro = () => {
        return window.open(`http://localhost:3000/cadastro`, '_self')
    }



    return (
        <header>
            <nav className="container">
                <div className="loc-nav-content">
                    <h1>Loc Casas</h1>
                    {/* <a href="https://github.com/vanessa-maganhoto"  >
                    <div className="loc-contact-container">
                        <GithubIcon/>
                        <p className="loc-contact-link">/vanessa-maganhoto</p>
                    </div>
                </a> */}


                    <Link to='/cadastro'><div onClick={retornarCadastro} className="btn  loc-btn-header">Cadastrar</div></Link>

                </div>
            </nav>
        </header>
    )
}
